const Example = () => {
  let diplayVal;
  return (
    <>
      <input
      type="text"
      onChange={(e) => {
        const input = ()=>{
          e.target.value;
        }
       
      }}/> = {diplayVal}
      <h3>={input}</h3>
        
        

    </>
  );
};
export default Example;
